import React from "react";
import { FoodCard } from "./FoodCard";

interface FoodItem {
  image: string;
  title: string;
  price: string;
  rating: number;
  quantity: string;
  description: string;
}

interface FoodSectionProps {
  title: string;
  icon: string;
  items: FoodItem[];
  className?: string;
}

export const FoodSection: React.FC<FoodSectionProps> = ({
  title,
  icon,
  items,
  className = "",
}) => {
  return (
    <section className={className}>
      <div className="flex gap-0.5 self-start text-4xl font-bold text-black mb-4">
        <img
          src={icon}
          className="object-contain shrink-0 self-start aspect-square w-[42px]"
          alt="Section icon"
        />
        <h2 className="basis-auto">{title}</h2>
      </div>
      <div className="w-full">
        <div className="flex gap-5 max-md:flex-col max-md:">
          {items.map((item, index) => (
            <div key={index} className="w-3/12 max-md:ml-0 max-md:w-full">
              <div className="max-md:mt-10">
                <FoodCard {...item} />
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};
